        [color=#1b487e]░░░░██░░██░██░██░[/color] [bold] Аванпост Фронтир[/bold]

        [color=#1b487e]░░░░██░░░████░███[/color]

        =============================================
                             Условия сдачи помещение в аренду
        =============================================

        Представителю Фронтиры теперь разрешено сдавать в аренду некоторые помещения в сторону транспортной остановки.

        Условия сдачи помещения:

        1. Авантюрист за свой счёт ремонтирует помещение.

        2. Представитель Фронтиры может оказывать свои услуги, если арендователь попросит этого, за определённую сумму кредитов.

        3. После окончания аренды - всё оборудование, что находится на арендованном месте - принадлежит уже аванпосту Фронтиры.

        4. Арендователь обязан заплатить полную сумму за 1 час работы. Если время подходит к концу - он может продлить это время, но он обязан сделать это течение 30 минут. В случаи неуплаты - всё оборудование внутри помещение - переходит под контроль аванпоста Фронтиры

        5. При нарушение корпоративного закона - Представитель Фронтиры имеет право разорвать контракт с арендователем, и все вещи, которые находятся в арендованном помещение - переходят под контроль аванпоста Фронтиры.


        Цена за сдачу аренды 1-ого помещения - 10 000 кредитов в час

        Цена за рекламу по консоли связи - 10 000 кредитов за 1 сообщение

        Оказание различных услуг - зависит от стоимости потраченных ресурсов + 5000 за оказание помощи. Пример: Ящик стали стоит 3000 кредитов. Вы отдаёте этот ящик ему - 3000 кредитов за ящик стали и 5000 кредитов за помощь. В итоге он должен заплатить 8000 кредитов.


